sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new GoogleDirectoryUtils();
    if (utils.isEmpty(inputs.group_key))
        throw new Error("Group key cannot be empty")

    var payload = {};
    if (inputs.name)
        payload.name = inputs.name;
    if (inputs.email)
        payload.email = inputs.email;
    if (inputs.description)
        payload.description = inputs.description;
    if (inputs.adminCreated)
        payload.adminCreated = inputs.adminCreated;
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

